function leftSidebarJSON(s){$("#drop-groupslist .label, #leftSidebar .fd-panel__title").append(s.title),$("#drop-groupslist .label, #leftSidebar .fd-panel__description").append(s.description),$.each(s.regions,function(i,e){var t;t='<li class="fd-list__group-header" id="group-'+this.id+'">'+this.name+" "+this.id+" ("+this.items.length+" items)</li>",$(t).appendTo("#leftSidebar .fd-list"),$(s.regions[i].items).each(function(){var e;e='<li class="fd-list__item">',e+='   <span class="fd-list__title">'+this.header+" "+this.id+"</span>",e+="</li>",$(e).insertAfter("#leftSidebar #group-"+s.regions[i].id),$("<option>"+this.header+"</option>").appendTo("#drop-groupslist select")})}),$("#drop-groupslist .count, #leftSidebar .fd-panel__footer").append(s.regions.length+" groups of tenants successfully loaded.")}function getLeftSidebarData(e){$.ajax({dataType:"json",url:e+"/src/json/leftSidebar.min.json",success:leftSidebarJSON,error:function(){console.log("No left sidebar JSON found.")},complete:function(){console.log("Left sidebar JSON loaded.")}})}